import React from 'react'
import './Cards.css'
import { cardsData } from '../../Data/Data'

export const Cards = () => {
  return (
    <div className='Cards'>
    {cardsData.map((card,id)=>{
        return(
            <div className='parentContainer'>
            <Card 
            title={card.title}
            color={card.color}
            
            />

            </div>
        )
    })}
    </div>
  )
}
